function generateTriggers(json) {
    let triggersText = "";
    let countTablesWith2pk = 0;

    for (const key in json) {
        const tableName = key;
        const tablePrefix = key.substring(0, 3);
        const tableInfo = json[key];
        const column = tableInfo.columns.find(c => c.name === propDataAtualizacao);
        if (!column) continue;
        if (tableInfo.name.startsWith(ignorePrefix)) continue;
        const pks = tableInfo.columns.filter(c => c.isPrimaryKey);
        const countPk = pks.length;
        if (countPk > 1) {
            countTablesWith2pk++;
            console.log(tableName);
            triggersText += `
            /*==============================================================*/
            /* Table: ${tableName.padEnd(54, " ")}*/
            /* Entity: ${tableInfo.conceptualName.padEnd(53, " ")}*/
            /*==============================================================*/
            CREATE TRIGGER TRG_POSTOFACIL00001_${tablePrefix}UPDDATA
            ON [${tableName}]
            AFTER UPDATE  AS
            update [${tableName}] set [${column.code}] = GETUTCDATE()
            where exists 
            (
                select inserted.${pks[0].code}
                from inserted 
                where 1=1
                ${pks.map(pk => `and [${tableName}].[${pk.code}] = inserted.${pk.code}`).join('\n    ')}
            )
            GO
            `.replace(/^ {12}/gm, "");
            continue;
        };

        triggersText += `
            /*==============================================================*/
            /* Table: ${tableName.padEnd(54, " ")}*/
            /* Entity: ${tableInfo.conceptualName.padEnd(53, " ")}*/
            /*==============================================================*/
            CREATE TRIGGER TRG_POSTOFACIL00001_${tablePrefix}UPDDATA
            ON [${tableName}]
            AFTER UPDATE  AS
            update [${tableName}] set [${column.code}] = GETUTCDATE()
            WHERE [${pks[0].code}] IN (SELECT [${pks[0].code}] FROM inserted);
            GO
            `.replace(/^ {12}/gm, "");
    }

    console.log(`Tables with more than 1 pk: ${countTablesWith2pk}`);

    write(`tests/triggers_${(new Date).toJSON().replace(/[^Z\d]/g, "_")}.sql`, triggersText);
}